  "translationLines": [
    {
      "lineNumber": 147681,
      "originalJapaneseLine": "「うぅん、助かった……ありがとう……」",
      "translatedEnglishLine": "\"Uhn, you saved me... thank you...\""
    },
    {
      "lineNumber": 147682,
      "originalJapaneseLine": "「あ、あの、エルシールさん、",
      "translatedEnglishLine": "\"Ah, um, Elsheal-san,"
    },
    {
      "lineNumber": 147683,
      "originalJapaneseLine": "　私達これからどうしたら……」",
      "translatedEnglishLine": " What should we do from now on...?\""
    },
    {
      "lineNumber": 147684,
      "originalJapaneseLine": "「ファーレン、リリム、アルカリア、",
      "translatedEnglishLine": "\"Fahren, Lilim, Arcaria,"
    },
    {
      "lineNumber": 147685,
      "originalJapaneseLine": "　三人に命令よ、他二人にも伝えて」",
      "translatedEnglishLine": " I’m giving an order to the three of you. Also, inform the other two.\""
    },
    {
      "lineNumber": 147686,
      "originalJapaneseLine": "「ケッセルリンク様がお目覚めになるまで、",
      "translatedEnglishLine": "\"Until Lord Kesselring wakes up,"
    },
    {
      "lineNumber": 147687,
      "originalJapaneseLine": "　どこか安全な場所に隠れなさい」",
      "translatedEnglishLine": " hide somewhere safe.\""
    },
    {
      "lineNumber": 147688,
      "originalJapaneseLine": "「え……私達も戦うのでは……」",
      "translatedEnglishLine": "\"Eh... aren’t we going to fight as well...?\""
    },
    {
      "lineNumber": 147689,
      "originalJapaneseLine": "「それは駄目。",
      "translatedEnglishLine": "\"That’s not allowed."
    },
    {
      "lineNumber": 147690,
      "originalJapaneseLine": "　ケッセルリンク様がそれを望まないから」",
      "translatedEnglishLine": " Lord Kesselring does not wish for that.\""
    },
    {
      "lineNumber": 147691,
      "originalJapaneseLine": "「う……はい……」",
      "translatedEnglishLine": "\"Uh... yes...\""
    },
    {
      "lineNumber": 147692,
      "originalJapaneseLine": "メイド達にとってケッセルリンクは絶対。",
      "translatedEnglishLine": "For the maids, Kesselring is absolute."
    },
    {
      "lineNumber": 147693,
      "originalJapaneseLine": "そう言われてはファーレンには",
      "translatedEnglishLine": "Hearing that, Fahren"
    },
    {
      "lineNumber": 147694,
      "originalJapaneseLine": "これ以上なにか言うことは出来ない。",
      "translatedEnglishLine": " couldn’t say anything more."
    },
    {
      "lineNumber": 147695,
      "originalJapaneseLine": "「ごめん……私が情けないせいで……」",
      "translatedEnglishLine": "\"Sorry... because I was pathetic...\""
    },
    {
      "lineNumber": 147696,
      "originalJapaneseLine": "「そ、そんなこと、エルシールさんは",
      "translatedEnglishLine": "\"Th-That’s not true, Elsheal-san"
    },
    {
      "lineNumber": 147697,
      "originalJapaneseLine": "　とても立派に戦いました……！」",
      "translatedEnglishLine": " fought very honorably...!\""
    },
    {
      "lineNumber": 147698,
      "originalJapaneseLine": "「ありがと、ファーレン……」",
      "translatedEnglishLine": "\"Thank you, Fahren...\""
    },
    {
      "lineNumber": 147699,
      "originalJapaneseLine": "「ごめん……少し、休むから……」",
      "translatedEnglishLine": "\"Sorry... I’m going to rest a bit...\""
    },
    {
      "lineNumber": 147700,
      "originalJapaneseLine": "それまでギリギリだったのだろう。",
      "translatedEnglishLine": "It seemed it was barely holding on until then."
    },
    {
      "lineNumber": 147701,
      "originalJapaneseLine": "エルシールは気を失い、安らかに寝息を立てだした。",
      "translatedEnglishLine": "Elsheal lost consciousness and began breathing peacefully."
    },
    {
      "lineNumber": 147702,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "............"
    },
    {
      "lineNumber": 147703,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 147704,
      "originalJapaneseLine": "「だー！　進め進め進め！",
      "translatedEnglishLine": "\"Dah! Advance, advance, advance!"
    },
    {
      "lineNumber": 147705,
      "originalJapaneseLine": "　そしてメイドを探し出せー！」",
      "translatedEnglishLine": " And find the maids!\""
    },
    {
      "lineNumber": 147706,
      "originalJapaneseLine": "「あ、あの、本当に戦うつもりですか？」",
      "translatedEnglishLine": "\"Um, um, do you really intend to fight?\""
    },
    {
      "lineNumber": 147707,
      "originalJapaneseLine": "「うん、もう私達の他に戦えそうなのいないし」",
      "translatedEnglishLine": "\"Yeah, there doesn’t seem to be anyone else who can fight besides us now.\""
    },
    {
      "lineNumber": 147708,
      "originalJapaneseLine": "「で、でも……",
      "translatedEnglishLine": "\"B-But..."
    },
    {
      "lineNumber": 147709,
      "originalJapaneseLine": "　エルシールさんは戦うなって……」",
      "translatedEnglishLine": " Elsheal-san told us not to fight...\""
    },
    {
      "lineNumber": 147710,
      "originalJapaneseLine": "「大丈夫よ、ファーレン。",
      "translatedEnglishLine": "\"It’s okay, Fahren."
    },
    {
      "lineNumber": 147711,
      "originalJapaneseLine": "　みんながやられた相手に",
      "translatedEnglishLine": " We don’t expect to defeat the enemy"
    },
    {
      "lineNumber": 147712,
      "originalJapaneseLine": "　私達二人で敵うとは思ってないから」",
      "translatedEnglishLine": " that took down everyone else, just the two of us.\""
    },
    {
      "lineNumber": 147713,
      "originalJapaneseLine": "「そーそー」",
      "translatedEnglishLine": "\"That’s right, that’s right.\""
    },
    {
      "lineNumber": 147714,
      "originalJapaneseLine": "「エルシールさんの言うことは分かるし、",
      "translatedEnglishLine": "\"We understand what Elsheal-san said,"
    },
    {
      "lineNumber": 147715,
      "originalJapaneseLine": "　私達が戦うのをケッセルリンク様が",
      "translatedEnglishLine": " and that Lord Kesselring doesn’t want us to fight,"
    },
    {
      "lineNumber": 147716,
      "originalJapaneseLine": "　望まないのも分かる」",
      "translatedEnglishLine": " as well.\""
    },
    {
      "lineNumber": 147717,
      "originalJapaneseLine": "「でも……",
      "translatedEnglishLine": "\"But..."
    },
    {
      "lineNumber": 147718,
      "originalJapaneseLine": "　なにもしないなんて出来ない」",
      "translatedEnglishLine": " I can’t do nothing.\""
    },
    {
      "lineNumber": 147719,
      "originalJapaneseLine": "「私達にだって時間稼ぎくらいなら",
      "translatedEnglishLine": "\"Even we think that at least buying time"
    },
    {
      "lineNumber": 147720,
      "originalJapaneseLine": "　なんとか出来るかなーって」",
      "translatedEnglishLine": " we might be able to manage.\""
    },
    {
      "lineNumber": 147721,
      "originalJapaneseLine": "「ファーレン、貴方は隠れていなさい。",
      "translatedEnglishLine": "\"Fahren, you stay hidden."
    },
    {
      "lineNumber": 147722,
      "originalJapaneseLine": "　いいわね」",
      "translatedEnglishLine": " Got it?\""
    },
    {
      "lineNumber": 147723,
      "originalJapaneseLine": "「ファーレンが怪我でもしたら、",
      "translatedEnglishLine": "\"If Fahren gets hurt,"
    },
    {
      "lineNumber": 147724,
      "originalJapaneseLine": "　私達がエルシールさんとパレロアさんに",
      "translatedEnglishLine": " we’ll get scolded severely by Elsheal-san and Paleloa-san,"
    },
    {
      "lineNumber": 147725,
      "originalJapaneseLine": "　こっぴどーく叱られちゃうもんね」",
      "translatedEnglishLine": " you know.\""
    },
    {
      "lineNumber": 147726,
      "originalJapaneseLine": "「…………あの、お二人とも気をつけて」",
      "translatedEnglishLine": "\"...Um, both of you, please be careful.\""
    },
    {
      "lineNumber": 147727,
      "originalJapaneseLine": "「おっけ、おっけ」",
      "translatedEnglishLine": "\"Okay, okay.\""
    },
    {
      "lineNumber": 147728,
      "originalJapaneseLine": "「ふん、気をつけることなんてないわ。",
      "translatedEnglishLine": "\"Hmph, there’s nothing to be careful about."
    },
    {
      "lineNumber": 147729,
      "originalJapaneseLine": "　倒せそうなら倒す、無理なら逃げるだけよ」",
      "translatedEnglishLine": " If we can defeat them, we will; if not, we’ll just run away.\""
    },
    {
      "lineNumber": 147730,
      "originalJapaneseLine": "「そーそー」",
      "translatedEnglishLine": "\"That’s right, that’s right.\""
    }
  ]
}

